INSERT INTO `v1_e1fc2ac78acff34d4ac9b5702dba0a39361a0e4ca5266cdeac58492e52a75067` VALUES (4, 11, 111011, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 1110501043, 0, 1110501, 1, "", 0, 1);
INSERT INTO `v1_e1fc2ac78acff34d4ac9b5702dba0a39361a0e4ca5266cdeac58492e52a75067` VALUES ("", 91, 0, "", 1110501044, "", 1110501, "", "", "", "");
