INSERT INTO `v1_e1fc2ac78acff34d4ac9b5702dba0a39361a0e4ca5266cdeac58492e52a75067` VALUES (4, 11, 111011, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 1110501046, 0, 1110501, 1, "", 0, 1);
INSERT INTO `v1_e1fc2ac78acff34d4ac9b5702dba0a39361a0e4ca5266cdeac58492e52a75067` VALUES ("", 91, 0, "", 1110501047, "", 1110501, "", "", "", "");
