INSERT INTO `v1_e1fc2ac78acff34d4ac9b5702dba0a39361a0e4ca5266cdeac58492e52a75067` VALUES (5, 11, 111011, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 1110501049, 0, 1110501, 1, "", 0, 1);
INSERT INTO `v1_e1fc2ac78acff34d4ac9b5702dba0a39361a0e4ca5266cdeac58492e52a75067` VALUES ("", 91, 0, "", 1110501050, "", 1110501, "", "", "", "");
